import Vue from 'vue'
import Router from 'vue-router'
import Home from '@/views/Home'

Vue.use(Router)

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      component: Home
    },
    // {
    //   path: '/todos',
    //   component: () => import('./views/Todos.vue')
    // },
    // {path: '/resume',
    //  component: ()=>import('./views/resume.vue')
    //  },
     {
      path: '*',

      meta: {layout: 'Deni'},
      component: () => import('./components/Denis.vue')
    },

  ]
})
